    return;
  }
  
  // 요청받은 파일의 URL을 설정
  const fileUrl = baseDir + req.path;
  console.log(fileUrl);
  
  // 파일을 읽음
  fs.readFile(fileUrl, function(err, data) {
    if (err)
      console.log(err);
    else {
      // 파일을 브라우저에게 전송
      res.writeHead(200, {'Content-Type': mime.getType(fileUrl)});
      res.end(data);
    }
  });
});

